@julia_ducournau has won the Palme d’Or for her film ‘Titane’ starring Agathe Rousselle and Vincent Lindon. Presented the award by Sharon Stone, the French director has become only the second woman in the history of the festival to receive the prestigious award, 28 years after Jane Campion’s ‘The Piano’. 🎬⭐️

Julia Ducournau a reçu des mains de Sharon Stone la Palme d’Or pour son film choc "Titane", porté par Agathe Rousselle, une révélation, et Vincent Lindon. La réalisatrice française devient ainsi la deuxième femme de l’histoire du @festivaldecannes à recevoir le prestigieux prix, 28 ans après Jane Campion pour "La Leçon de piano".
#cannes2021 #titane
